import React from "react";
import {CircularProgress} from "@material-ui/core";
import './Loading.css';
import LoadingText from '../components/LoadingText';

function Loading() {
	return (
		<div className="loading-screen">
			<CircularProgress color="secondary" /> <br />
			<div>
				<LoadingText />
			</div>
		</div>
	);
}

export default Loading;
